CREATE TABLE `memberpayment` (
  `pid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fmid` int(10) unsigned NOT NULL COMMENT '充值人:0为系统',
  `tmid` int(10) unsigned NOT NULL COMMENT '接收人ID',
